import React from 'react';
import 'antd/dist/antd.css';
import {withRouter} from 'react-router-dom';
import { PageHeader, Icon, Button, Modal } from 'antd';

const { confirm } = Modal;

export default class Header extends React.Component {

    constructor(props){
        super(props);
    }  

    handleLogout = (e) => {
        console.log("Props", this.props);
        e.preventDefault();
        confirm({
          title: 'Do you want to logout?',
          onOk: () => {
              console.log("Props", this.props);
            // this.props.history.push('/')
          },
          onCancel() {
            console.log('Cancel');
          },
        });
    }

    render () {

        const {history} = this.props;
        const routes = [
            {
                path: '/',
                breadcrumbName: "Home",
            },
            {
                path: 'first',
                breadcrumbName: 'Second-level Menu',
            },
            {
                path: 'second',
                breadcrumbName: 'Third-level Menu',
            },
        ];

    return (
        <PageHeader
            title="Pramuditha Kaushalya"
            style={{
            background: 'white',    
            border: '1px solid rgb(235, 237, 240)',
            }}
            subTitle="Intern"
            extra={[
            <Button key="1" type="primary" onClick={this.handleLogout} shape="circle">
               <Icon type="logout" />
            </Button>
            ]}
            
            avatar={{ src: 'https://avatars1.githubusercontent.com/u/8186664?s=460&v=4', size: '100px'}}
            breadcrumb={{ routes }}
        >
        </PageHeader>
        );
    }
}
